import React from 'react';
import logo from './logo.svg';
import './App.css';
import About from "./Pages/About"
import Navbar from "./Components/NavBar/NavBar"
import Footer from "./Components/Footer/Footer"
import Home from "./Pages/Home"

import Portfolio from "./Pages/Portfolio"
import Contact from "./Pages/Contact"
import Skills from "./Pages/Skills"
import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";


const pageStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "https://upload.wikimedia.org/wikipedia/commons/4/46/Curiosity_at_Work_on_Mars_%28Artist%27s_Concept%29.jpg"
};

function App() {
  return (
    <Router>
    <div style={pageStyle}>
        <Navbar />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/saved" component={About} />
          <Route exact path="/books/:id" component={Portfolio} />
          <Route exact path="/contact" component={Contact} />

          <Footer/>
        </Switch>
    </div>
  </Router>
  );
}

export default App;
